import React, { Component } from "react";
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import Posts from "./Posts";

class Router extends Component {


    render() {

        return (

            <BrowserRouter>


                <Routes>
                    <Route path="/posts" element={<Posts />} />




                </Routes>



            </BrowserRouter>


        );
    }
}


export default Router;
